import React from "react";

import CategoryReport from "../components/CategoryReport";

const AdminShop = () => {
    return (
        <div className="root-admsp">
            <div className="admsp-header">
                <CategoryReport />
            </div>
            <div className="switchList"></div>
        </div>
    );
};

export default AdminShop;
